            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "Misc. items associated with number, decimal point, zero character, etc.\n"
                },
                {
                  "kind": "span",
                  "text": "Numbering system used by the locale (defined by the CLDR data).  E.g.,\n"
                },
                {
                  "kind": "span",
                  "text": "\"latn\" corresponds to the standard Western digits, \"0123456789\", \"arab\"\n"
                },
                {
                  "kind": "span",
                  "text": "with the Arabic digits.\n"
                },
                {
                  "kind": "span",
                  "text": "Note: While the item values here use the term \"Character\", locales can\n"
                },
                {
                  "kind": "span",
                  "text": "have strings values, e.g., Exponent_Character in English \"E\" while the\n"
                },
                {
                  "kind": "span",
                  "text": "Swedish value is \" x 10^\" (ASCII representation).\n"
                }
              ]
            }
